import React, { useState, useEffect } from 'react';
import './Results.css'; // Import du fichier CSS

function Results() {
  const [results, setResults] = useState([]);

  useEffect(() => {
    fetch('http://localhost:8000/api/results')
      .then(response => response.json())
      .then(data => setResults(data));
  }, []);

  const getColorClass = (value) => {
    return value === "true" ? 'result-true' : 'result-false';
  };  

  return (
    <table>
      <thead>
        <tr>
          <th>Link</th>
          <th>Result 1</th>
          <th>Result 2</th>
          <th>Result 3</th>
        </tr>
      </thead>
      <tbody>
        {results.map(result => (
          <tr key={result.id}>
            <td>{result.link}</td>
            <td className={`${getColorClass(result.result1)}`}>{result.result1.toString()}</td>
            <td className={`${getColorClass(result.result2)}`}>{result.result2.toString()}</td>
            <td className={`${getColorClass(result.result3)}`}>{result.result3.toString()}</td>
          </tr>
        ))}
      </tbody>
    </table>
  );
}

export default Results;
